import React, { useState, useEffect } from "react";
import styled from "styled-components";
import { TYPE } from "theme";

interface Props {
  listTitle: string,
  stringList: string[],
  theme?: string;
}

function showItems(list: string[]) {
  if (list.length == 0 || list[0] === '') {
    return 'Nothing found, please enter another keyword';
  } else {
    return list.map((item: string) => (
      <ListItem> {item} </ListItem>
    ))
  }
}

const StringsList: React.FC<Props> = ({ stringList, listTitle, theme }) => {
  return (
    <MainContainer>
      <TYPE.H4>{listTitle}</TYPE.H4>
      <ListContainer>
        {stringList.map((str) => (
          <ListItem> {str} </ListItem>
        ))}
        { showItems(stringList) }
      </ListContainer>
    </MainContainer>
  );
};

const MainContainer = styled.div`
  text-align: left;
  width: 80%;
`;

const ListContainer = styled.ul`
  list-style: none;
  padding: 0;
`;

const ListItem = styled.ul`
  border: 1px solid #e6e6e6;
  border-radius: 12px;
  margin: 1em 0;
  padding: 1em 1em;
`;

export default StringsList;
